(11, 'For Send Job Request to Linguist', '<meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n<meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n<meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge,chrome=1\">\n<meta name=\"format-detection\" content=\"telephone=no\"> <!-- disable auto telephone linking in iOS -->\n<title></title>\n<link href=\"https://fonts.googleapis.com/css?family=Roboto\" rel=\"stylesheet\">\n<style>\n	html,\n	body,\n	p {\n		font-family: \'Roboto\', sans-serif;\n		font-size: 14px;\n	}\n</style>\n<table style=\"display: table;border-collapse: separate;box-sizing: border-box;\" border=\"0\" width=\"100%\" align=\"center\">\n	<tbody>\n		<tr>\n			<td>\n				<table style=\"border: 1px solid #c9d6df;border-radius:20px;box-sizing: border-box;border-collapse: collapse; border: 1px solid #d1c7c7 !important;background-color: #fff;\" border=\"1\" width=\"600\" align=\"center\">\n					<tbody>\n						<tr>\n							<td>\n								<table style=\"display: table;border-collapse: separate;box-sizing: border-box;box-sizing: border-box;border-collapse: collapse;\" border=\"0\" align=\"center\" width=\"100%\">\n									<tbody>\n										<tr>\n											<td style=\"padding: 15px;/* height: 50px; */background-color: #efefef;border-bottom: 1px solid #bfbfbf;\">\n												<center> <img src=\"https://tms.beconnected.no/assets/img/logo.png\" class=\"img-full\" alt=\"...\" style=\"max-height: initial;width: 250px;\"> </center>\n											</td>\n										</tr>\n										<tr>\n											<td style=\"padding: 15px;\">\n												<p><span>Hi!<br></span></p>\n\n												<div><span>Please log in to accept the job or click on the below link.</span><br><br></div>\n												<div><span> </span></div>\n												<div>\n													<span><b>JOB</b></span><br><span>[JOBNO]</span><br><br><span><b>LANGUAGES</b></span><br><span>[LANGUAGES]</span><br><br><span><b>Job Status </b></span><br><span>[JOBSTATUS]</span><br><br><span><b>Due Date</b></span><br><span>[DUEDATE]</span><br><br>\n												</div>\n												<div>\n													<span><b>Click here to see the job details</b></span><br><br>\n													<span>[JOBDETAILS]</span><br><br>\n													<!-- <span><b>Click here to accept the job</b></span><br><br>\n													<span>[ACCEPTLINK]</span><br><br>\n													<span><b>Click here to reject the job</b></span><br><br>\n													<span>[REJECTLINK]</span><br><br> -->\n												</div>\n												<div><span> </span></div>\n												\n											</td>\n										</tr>\n										<tr>\n											<td style=\"padding: 5px;background-color: #efefef;border-top: 1px solid #b5b5b5;\">\n												<center>\n													<div style=\"text-align: left;\"><span>For more information, visit us\n															at <a style=\"color: #000000;\" href=\"https://www.beconnected.no\"><u>www.beconnected.no</u></a></span>\n													</div>\n													<div style=\"text-align: left;\"><span style=\"color: #ffffff;\"><u style=\"color: rgb(255, 255, 255);\"><br></u></span></div>\n													<div> </div>\n													<div style=\"text-align: left;\"><span><em>This email and any attachments to it may be confidential and are intended solely for the use of the individual to whom it is addressed. If you are not the intended recipient of this email, you must neither take any action based upon its\n																contents, nor copy or show it to anyone. If you have received this transmission in error, please use the reply function to tell us and then permanently delete what you have received.</em></span></div>\n													<div> </div>\n													<div> </div>\n												</center>\n											</td>\n										</tr>\n									</tbody>\n								</table>\n							</td>\n						</tr>\n					</tbody>\n				</table>\n			</td>\n		</tr>\n</tbody>\n</table>', 'You have a new job request | BeConnected', 8, '', 1, 1, '2018-10-29 18:29:14', '2024-03-06 17:01:40'),
(12, 'Invoice to client', '<meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n<meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n<meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge,chrome=1\">\n<meta name=\"format-detection\" content=\"telephone=no\"> <!-- disable auto telephone linking in iOS -->\n<title></title>\n<div><span style=\"font-family: Khmer UI,geneva;\">Hi!</span></div>\n<div>&nbsp;</div>\n<div><span style=\"font-family: Khmer UI,geneva;\">We are hereby sending our invoice [INVOICENO].</span><br><br></div>\n<div><span style=\"font-family: Khmer UI,geneva;\">Payment for this invoice is due by [PAYDUE].</span><br><br><span style=\"font-family: Khmer UI,geneva;\">Thank you!</span></div>\n<div>&nbsp;</div>', 'Invoice', 9, '', 1, 1, '2023-06-02 16:57:05', '2023-06-02 17:14:52'),
(13, 'Purchase Order (Email Content)', '<meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n<meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n<meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge,chrome=1\">\n<meta name=\"format-detection\" content=\"telephone=no\"> <!-- disable auto telephone linking in iOS -->\n<title></title>\n\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">Hi [Name1],</span></div>\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">?</span></div>\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">Thank you so much for helping us with this\n        project!</span></div>\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">?</span></div>\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">Download the files you need for the project\n        directly</span>:<br style=\"font-family: khmer ui,geneva; font-size: x-small;\" /><span\n        style=\"font-family: khmer ui,geneva; font-size: x-small;\">[DownloadURL]<br /></span></div>\n<div>?</div>\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">Here is an overview of the project:</span></div>\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">?</span></div>\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">CLIENT:</span></div>\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">[IndirectCustomer]</span></div>\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">?</span></div>\n<div>\n    <div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">PO Number:</span></div>\n    <span style=\"font-family: khmer ui,geneva; font-size: x-small;\">[Item]</span>\n</div>\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">?</span></div>\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">TASK:</span><br /><span\n        style=\"font-family: khmer ui,geneva; font-size: x-small;\">[JobService]</span></div>\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">?</span></div>\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">DEADLINE:</span><br /><span\n        style=\"color: #ff0000; font-family: khmer ui,geneva; font-size: x-small;\">[DelivDeadline]</span></div>\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">?</span></div>\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">INSTRUCTIONS:</span></div>\n<div><span style=\"background-color: #ffff00; font-family: khmer ui,geneva; font-size: x-small;\">[JobComment]</span>\n</div>\n<div>\n    <div>?</div>\n    <div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\"><span\n                style=\"font-family: khmer ui,geneva; font-size: x-small;\">COMPANY TO INVOICE</span></span></div>\n    <span style=\"font-family: khmer ui,geneva; font-size: x-small;\">BeConnected AS </span><span\n        style=\"font-family: khmer ui,geneva; font-size: x-small;\"> </span>\n    <div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">?</span></div>\n    <span style=\"font-family: khmer ui,geneva; font-size: x-small;\">PAYMENT</span>\n</div>\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">[Total]</span>\n    <div>?</div>\n    <div>\n        <div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">You can log into the job in Plunet by\n                following the link below:</span></div>\n        <div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">[QuickJobLink]</span></div>\n    </div>\n    <div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">?</span></div>\n</div>\n<div><span style=\"font-family: khmer ui,geneva; font-size: x-small;\">Thank you!</span></div>\n<div>?</div>', 'Purchase Order', 10, '', 1, 1, '2023-06-15 16:57:05', '2024-04-02 14:43:25');
