(15, 'Purchase Order (Attachment)', '<style>\n    @font-face {\n        font-family: \'khemarUI\'; /* Specify the name for your font family */\n        src: url(\'assets/fonts/KhmerUI.ttf\') format(\'truetype\'); /* Path to your TTF file */\n    }\n    .invoice, .fontszsm, .address-title {\n        color: #2a2727;\n    }\n    .invoiceheader {\n        padding: 0 15px;\n    }\n    .panel-heading-img {\n        float: right;\n    }\n    .header-tr-border {\n        background-color: #bebebe;\n    }\n    table.table.table-bordered.table-condensed-second {\n        margin: 0px;\n        margin-top: 10px;\n        background-color: #d9d9d9 !important;\n    }\n    table.table.table-bordered.table-condensed-second tbody tr:nth-of-type(odd) td {\n        background: #d9d9d9 !important;\n    }\n    .table-condensed-second tbody tr {\n        background: #d9d9d9 !important;\n    }\n    .invoice {\n        width: 590px !important;\n        margin: 10px auto;\n        /* font-family: Khmer UI, serif; */\n        font-family: \'KhmerUI\', serif;\n        margin-left: -15px;\n    }\n    .invoice .panel-heading {\n        background-color: #fff !important;\n        border-color: #fff !important;\n    }\n    .invoice .invoice-header {\n        padding: 25px 25px 15px;\n    }\n    .invoice .invoice-header h1 {\n        margin: 0;\n    }\n    .invoice .invoice-header .media .media-body {\n        font-size: 0.9em;\n        margin: 0;\n    }\n    .invoice .invoice-body {\n        width: 590px !important;\n        border-radius: 10px;\n        padding-top: 12px;\n        padding-bottom: 12px;\n        background: #fff;\n    }\n    .invoice-content {\n        padding-left: 60px;\n        padding-right: 60px;\n    }\n    .dl-horizontal {\n        margin: 0;\n        line-height: 1.2;\n        padding: 12px;\n    }\n    .panel-body-image {\n        text-align: center;\n    }\n    .panel-body-image img {\n        width: 200px;\n        height: 100px;\n    }\n    .invoice-heading {\n        font-size: 18px;\n    }\n    .invoice-purchase-side dd {\n        display: flex;\n        justify-content: space-between;\n        padding: 5px;\n    }\n    .table-data-txt {\n        font-size: 14px;\n    }\n    tbody,td,tfoot,th,thead,tr {\n        border-style: unset !important;\n    }\n    .panel-body.table-payment-title {\n        margin-top: 50px;\n    }\n    .list-unstyled li a {\n        font-weight: 600;\n        text-decoration: none;\n        color: #000082;\n    }\n    .list-unstyled-one p,\n    .list-unstyled-two {\n        list-style-type: none;\n        margin: 0px;\n    }\n    .list-unstyled-one a {\n        font-size: 18px;\n        text-decoration: none;\n    }\n    .list-unstyled-two a {\n        font-size: 18px;\n        color: #000;\n    }\n    p.panel-title-footer-end {\n        text-align: end;\n    }\n    p.panel-titlefooter-start,\n    p.panel-title-footer-end {\n        padding-top: 10px;\n    }\n    .panel-default-btn {\n        float: right;\n    }\n    a.invoice-print-btn {\n        padding: 8px 20px;\n        border: 1px solid #dee2e6;\n        border-radius: 6px;\n        text-transform: uppercase;\n        background: #fff;\n        color: #000;\n        text-decoration: none;\n    }\n    a.invoice-download-btn {\n        text-transform: uppercase;\n        padding: 8px 20px;\n        border: none;\n        border-radius: 6px;\n        background: #000082;\n        color: #fff;\n        text-decoration: none;\n    }\n    .invoice-header-total {\n        margin-bottom: 20px;\n        border-bottom: 1px solid #dee2e6;\n    }\n    td.table-data-text {\n        padding: 0px 10px !important;\n    }\n    .dl-horizontal dd {\n        margin-left: auto;\n    }\n    .invoice .panel {\n        margin-bottom: initial !important;\n    }\n    .invoice .panel-body {\n        padding-left: initial !important;\n    }\n    .invoice .panel>.panel-body+.table {\n        border-top: none;\n    }\n    .fontszmdm{\n        font-size: 11px;\n    }\n    .inv-footer .table-data-text, .fontszsm, .copytext {\n        font-size: 10px;\n        color: #808080;\n    }\n    .copytext {\n        text-align: center;\n        margin-top: 10px;\n    }\n    .pb-0 {\n        padding-bottom: 0px;\n    }\n    .mb-d {\n        margin-bottom: 2px;\n    }\n    .txtalign {\n        text-align: right !important;\n    }\n    .txtcenter {\n        text-align: center !important;\n    }\n    .tbldd dd {\n        margin-bottom: 5px;\n    }\n    .table-condensed-second>tbody>tr>td {\n        padding-bottom: 3px !important;\n        padding-bottom: 3px !important;\n    }\n    .line1 { border-top: 1px solid #ea7227; width: 25%; } .line2 { border-top: 1px solid #e63132; width: 25%; } .line3 { border-top: 1px solid #4c9acc; width: 25%; } .line4 { border-top: 1px solid #5fc752; width: 25%; }\n    .mdot::after{content:\'\\00B7\';padding-right:2px;}\n    .mstar::after{content:\' | \';vertical-align: middle;font-size: smaller;}\n    .ptb{ padding: 5px 0; margin: 8px 0;}\n    .vertical-table {\n        display: table;\n        border-collapse: collapse;\n    }\n    .vertical-table .table-row {\n        display: table-row;\n    }\n    .vertical-table .table-cell {\n        display: table-cell;\n        padding: 3px 20px 3px 0px;\n    }\n    </style>\n<div class=\"container invoice invoiceContent\" id=\"invoiceContent\">\n    <div class=\"invoice-body\">\n        <div class=\"invoiceheader\">\n            <div class=\"row\">\n                <div class=\"col-lg-12 col-md-12 col-sm-12\">\n                    <div class=\"panel panel-default \">\n                        <div class=\"panel-heading-img\"> <img src=\"assets/img/invoice_logo.png\" alt=\"Logo\" srcset=\"\" style=\"max-width:240px;\"> </div>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <div class=\"invoice-content\">\n            <div class=\"row\">\n                <div class=\"col-sm-12\" style=\"padding-left:0px;\">\n                    <div class=\"panel panel-default fontszmdm\">\n                        <div class=\"panel-heading ptb\">\n                            <p class=\"address-title fontszsm\" style=\"padding-left: 15px; margin-bottom:0px;\"> <span class=\"mstar\">[COMPANY_NAME] </span> <span>[COMPANY_ADDRESS], </span> <span>[COMPANY_CITY] [COMPANY_POSTCODE], </span>  <span>[COMPANY_COUNTRY]</span> </p>\n                        </div>\n\n                        <div class=\"panel-body ptb\">\n                            <dl class=\"dl-horizontal\" style=\"padding:0 15px;\">\n                                <dd><strong>  [NAME1] [NAME2] </strong></dd>\n                                <dd> [STREET1][STREET2] </dd>\n                                <dd> [POSTCODE] <span>[CITY]</span></dd>\n                                <dd> [COUNTRY] </dd>\n                            </dl>    \n                        </div>\n                        <div class=\"panel-body ptb\">\n                            <!-- <div class=\"col-sm-4\">\n                                <p class=\"mb-d\"><strong>Project Manager</strong></p>\n                                [PROJECT_MANAGER]\n                            </div>\n                            <div class=\"col-sm-4\">\n                                <p class=\"mb-d\"><strong>Email</strong></p> [EMAIL]\n                            </div> -->\n                            <div class=\"col-sm-4\">\n                                <p class=\"mb-d\"><strong>Date</strong></p> \n                                [ORDERDATE]\n                            </div>\n                        </div>\n                    </div>\n                </div>\n            </div>\n            <div class=\"row\">\n                <div class=\"panel panel-default invoice-header-height\">\n                    <div class=\"panel-body ptb\" style=\"margin: 0;\">\n                        <dl class=\"dl-horizontal\"  style=\"padding: 0 15px;\">\n                            <dd class=\"invoice-heading\" style=\"font-size:14px;\"><strong>Purchase Order | [JOBNO] </strong></dd>\n                    </div>\n                </div>\n            </div>        \n            <div class=\"row\">\n                <div class=\"panel panel-default invoice-header-height\">\n                    <div class=\"row\">\n                        <div class=\"col-lg-12 col-md-12 col-sm-12\">\n                            <div class=\"panel panel-default fontszmdm\">\n                                <div class=\"panel-body ptb\">\n                                    <div class=\"col-sm-12\" style=\"margin-bottom: 2px;padding-left:15px;\">\n                                        <p>Thank you so much for helping us with the following project:</p>\n                                    </div>\n                                    <div style=\"padding-left: 15px;min-height:320px;\">\n                                        <div class=\"vertical-table\" >\n                                            <div class=\"table-row\">\n                                                <div class=\"table-cell\"> <b>PO Number:</b> </div>\n                                                <div class=\"table-cell\">[PROJECTNAME]</div>\n                                            </div>\n                                            <div class=\"table-row\">\n                                                <div class=\"table-cell\"><b>Client:</b></div>\n                                                <div class=\"table-cell\"> [INDIRECT_CUSTOMER] </div>\n                                            </div>\n                                            <div class=\"table-row\">\n                                                <div class=\"table-cell\"><b>Task:</b></div>\n                                                <div class=\"table-cell\"> [JOBSERVICE]</div>\n                                            </div>\n                                            <div class=\"table-row\">\n                                                <div class=\"table-cell\"><b>Languages:</b></div>\n                                                <div class=\"table-cell\"> [LANGUAGES]</div>\n                                            </div>\n                                            <div class=\"table-row\">\n                                                <div class=\"table-cell\"><b>Instructions:</b></div>\n                                                <div class=\"table-cell\"> [INSTRUCTIONS] </div>\n                                            </div>\n                                            <div class=\"table-row\">\n                                                <div class=\"table-cell\"><b>Deadline:</b> </div>\n                                                <div class=\"table-cell\"> <span style=\"color:red\"> [DEADLINE] </span> </div>\n                                            </div>\n                                            <div class=\"table-row\">\n                                                <div class=\"table-cell\"><b>Company to invoice:</b></div>\n                                                <div class=\"table-cell\"> BeConnected AS </div>\n                                            </div>\n                                            <div class=\"table-row\">\n                                                <div class=\"table-cell\"><b>Total Amount:</b></div>\n                                                <div class=\"table-cell\"> [TOTALAMOUNT] </div>\n                                            </div>\n                                            <!-- <dd> <strong> Word Count: </strong> [WORDCOUNT] </dd> -->\n                                        </div>\n                                    </div>\n                                    <!-- <dl class=\"dl-horizontal tbldd\" style=\"padding-left: 15px;\">\n                                        <dd> <strong> PO Number: </strong> [PROJECTNAME] </dd>\n                                        <dd> <strong> Client: </strong> [INDIRECT_CUSTOMER] </dd>\n                                        <dd> <strong> Task: </strong> [JOBSERVICE] </dd>\n                                        <dd> <strong> Languages: </strong> [LANGUAGES] </dd>\n                                        <dd> <strong> Instructions: </strong> [INSTRUCTIONS] </dd>\n                                        <dd> <strong> Deadline: </strong> <span style=\"color:red\"> [DEADLINE] </span> </dd>\n                                        <dd> <strong> Company to invoice: </strong> BeConnected AS [CompanyCodeShort]</dd>\n                                        \n                                        \n                                        <dd> <strong> Total Amount: </strong> [TOTALAMOUNT] </dd>\n                                    </dl>     -->\n                                </div>\n                            </div>\n                        </div>\n                    </div>\n                </div>\n            </div>        \n            <div class=\"row\">\n                <div class=\"panel panel-default invoice-header-height\" style=\"text-align:center;\">\n                    <p class=\"fontszsm\"> \n                        Please make sure to state the following project number [JobNo] on your invoice and remember to invoice the following company: BeConnected.\n                        Please send all invoices to accounting@beconnected.no.\n                    </p>\n                </div>\n            </div>  \n        </div> \n        <div class=\"invoicefooter\">\n            <div class=\"row\">\n                <div class=\"panel panel-default invoice-header-height\" style=\"margin: 0 15px;\">        \n                    <div class=\"d-flex\">\n                    <div class=\"line1\"> </div>\n                    <div class=\"line2\"> </div>\n                    <div class=\"line3\"> </div>\n                    <div class=\"line4\"> </div>\n                    </div>\n                    <table class=\"