(176, 0, 132, 2, '{\"memos\":\"Always out \\\"0% VAT for cross-border services\\\" in the invoice description!!! Your invoices should be sent after receiving Purchase Orders from us to the following e-mail address: Inter Accounts Payable, vendor.inv@intertransl.com\\n\\nThere will be a name and e-mail address of the Invoice recipient indicated on every Purchase Order. Usually it will be Inter Accounts Payable, vendor.inv@intertransl.com Please note that you can and are encouraged to include several Purchase Orders into a single Invoice if they indicate the same name of Invoice recipient. (We cannot process “mixed” Invoices covering Purchase Orders issued by different Cost Centers and will have to ask for splitting them if it turns out that some POs were issued by a non-centralized Cost Center. In this case name and e-mail of your Invoice recipient for particular Purchase Order will be clearly indicated on it.)\\nPreferred is one invoice round per month within the first decade. Feel free to send your Invoices to every Invoice Recipient covering all the Purchase Orders for the assignments finished during previous month for the particular Cost Center.\\n\\nPlease check if invoice confirmation email has been received within a couple of days after its sending!\",\"country_code\":\"\",\"tax_id\":\"\"}', '{\"payment_method\":\"Bank Transfer\",\"currency_code\":\"EUR\"}', 0, '2024-04-22 17:11:57', '2024-04-22 17:11:57'),
