(194, 0, 134, 2, '{\"memos\":\"What to include in your invoice:\\n• Our collaborator code for Versacom: BECONNEC\\n• The Versacom project number\\n• Your invoice number\\n\\nSubmit only one invoice PER WEEK covering all projects completed the previous week. For projects with long turnarounds, you can send separate invoices for the files delivered, even if the project is not over.\\nInvoices must be sent to facturescollaborateurs@versacom.ca each Monday before 10 a.m. Montreal local time.\\nThe invoice date should be the Monday immediately following the workweek covered by\\nthe invoice, as shown here:\\n10 euro bank fee\\nVersacom does not issue purchase orders. It is therefore extremely important that you save the standard assignment email you receive at the start of every project.\\nAlways include the following information on your invoice:\\n?\\tRecipient: Versacom, 1501 McGill College Avenue, 6th Floor, Montréal, Québec  H3A 3M8\\n?\\tCollaborator code (If you do not know what your code is, please ask)\\n?\\tFirst and last name, and company name if applicable\\n?\\tYour invoice number \\n?\\tThe Versacom project number (ABCDE1234567)\\n?\\tService descriptions should include the service type (translation, TEP, revision, terminology, etc…) as well as the language pair\\n?\\tFor each service category, the total words or hours and the associated fees (although the same rate applies to both internal and external fuzzy matches, they should be listed separately on the invoice.)\\n?\\tSubmit one invoice per week covering all projects completed the previous week.\\n?\\tWe must receive your invoice between 2 p.m. Friday and 10 a.m. Monday. \\n?\\tFor projects with long turnarounds, you can send separate invoices for the files delivered, even if the project is not over.\\n\\n?\\tSubmit invoices in PDF format.\\n?\\tWe recommend using the invoice template (Excel) included in the toolkit. \\n?\\tIf you prefer to use your own invoicing system, remember to include the information listed above.\\n10 euro bank fee on 04.06.2020;09.07.2020;03.09.2020; 08.10.2020\",\"country_code\":\"\",\"tax_id\":\"\"}', '{\"payment_method\":\"Bank Transfer\",\"currency_code\":\"EUR\"}', 0, '2024-04-23 14:55:36', '2024-04-23 14:55:36'),
